import React, { FC, PropsWithChildren } from 'react';
import Link from 'next/link';
import { Input, Menu, MenuProps } from 'antd';

const items: MenuProps['items'] = [
  {
    type: 'group',
    label: (
      <Link href={'/'}>
        <a>Home</a>
      </Link>
    ),
  },
  {
    type: 'group',
    label: (
      <Link href={'/profile'}>
        <a>Profile</a>
      </Link>
    ),
  },
  {
    type: 'group',
    label: <Input.Search style={{ verticalAlign: 'middle' }} />,
  },
  {
    type: 'group',
    label: (
      <Link href={'/signup'}>
        <a>Signup</a>
      </Link>
    ),
  },
];

export const AppLayout: FC<PropsWithChildren> = ({ children }) => {
  return (
    <div>
      <Menu
        mode='horizontal'
        items={items}
      />
      {children}
    </div>
  );
};
